import logo from './logo.svg';
import './App.css';
import Navs from './components/Navs';
function App() {
  let Component 
  switch(window.location.pathname){
    case "/":
      Component = <App/>
      break
    case "/about":
      Component = <About/>
      break
    case "/skills":
      Component = <Skills/>
      break
    case "/contact":
      Component = <Contact/>
      break
  }
  return (
    <>

      <Navs/ >
      {Component}
    </>
  );
}

export default App;
